import React, { Component } from "react";
import { Router, Link as LinkBase } from "@reach/router";
import { Flex as FlexBase, Heading, Text } from "rebass";
import styled from "styled-components";
import { minHeight, space } from "styled-system";

import StockTracker from "./components/StockTracker";

const Flex = styled(FlexBase)`
  ${minHeight}
`;

const Link = styled(LinkBase)`
  ${space}
`;
class App extends Component {
  render() {
    return (
      <Flex
        flexDirection="column"
        bg="pink"
        minHeight="100vh"
        alignItems="center"
        // justifyContent="center"
        width={[1]}
        className="App"
      >
        <Flex p={3} flexDirection="row" width={[1]}>
          <Link mx={2} to="/">
            <Text color="white">Home</Text>
          </Link>
          <Link mx={2} to="dashboard">
            <Text color="white">Dashboard</Text>
          </Link>
        </Flex>
        <Router>
          <Home path="/" />
          <StockTracker path="/stocks" />
        </Router>
      </Flex>
    );
  }
}
export default App;

const Home = () => <div>Home</div>;
